import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <img src={require('../logoClinica2.png')} alt="React Logo" className=" px-4 py-2"/>
    <App />
  </React.StrictMode>
);
